## Delete records
```js
// del 方法接收一个数组值，可以同时删除多条 record，单次请求可最多删除10条 record
datasheet.records.delete({{ recordIds }}).then(response => {
  if (response.success) {
    console.log(response.data);
  } else {
    console.error(response);
  }
})
```
